import React,{Fragment} from "react"
import {PlaylistTitle} from "../../component/title"
import playlist from "../../static/css/playlist.module.css"
export default function PlayList(){
    return (
        <Fragment>
            <div className={playlist.content}>
            <PlaylistTitle/>
            <div>我是歌单</div>
            </div>
        </Fragment>
    )
}
